import React, { Component } from 'react'
import '../App.css';
import { Link } from 'react-router-dom';
import SearchComponent from './SearchComponent'
class NotFound extends Component {


    render() {
        return (
            <div className="notfound">
            <img id="notFound" src="https://miro.medium.com/max/1200/1*G_0pNJ2R2WtWRDtKsxvYGg.jpeg" alt="warning"/>
            <Link>
            <button component={SearchComponent} to="/Search-Image">Main Page</button>
            </Link>
            </div>
        )
    }
}

export default NotFound
